import image from '../../../res/23619.jpeg';
const ItemTopLocations = () => {
  return (
    <div
      style={{
        width: 200,
        height: 150,
        backgroundColor: '#eeeeee',
        marginLeft: 2,
        marginRight: 2,
      }}
    >
      <div>
        <img src={image} style={{width: 200, height: 150}}>
          <strong>Location name</strong>
        </img>
      </div>
    </div>
  );
};
export default ItemTopLocations;
